import React, { useState } from 'react';
import logo from './logo.svg';
import './App.css';
import Header from './component/header';
import { Container, Row, Col, ButtonGroup, Dropdown } from 'react-bootstrap';
import './App.css';

function App() {
  const [showProperty, setShowProperty] = useState('show');

  return (
    <Container fluid='sm'>
      <Header />
      <Row>
        <Col md={5} xs={12}>
          <Dropdown as={ButtonGroup}>
            <Dropdown.Toggle className="width-100">
              <p className='nav-menu'>Authors</p>
            </Dropdown.Toggle>
            <Dropdown.Menu className="width-100">
              <Dropdown.Item eventKey="1" className='pl-5 h3'>Add new author</Dropdown.Item>
              <Dropdown.Item eventKey="2" className='pl-5 h3'>Find author</Dropdown.Item>
              <Dropdown.Item eventKey="3" className='pl-5 h3'>Find authors</Dropdown.Item>
              <Dropdown.Item eventKey="4" className='pl-5 h3'>Update author</Dropdown.Item>
              <Dropdown.Divider />
              <Dropdown.Item eventKey="5" className='pl-3 h3'>Delete author</Dropdown.Item>
            </Dropdown.Menu>
          </Dropdown>
        </Col>
        <Col md={{ span: 5, offset: 2 }} xs={12}>{`md={{ span: 4, offset: 4 }}`}</Col>
      </Row>
    </Container>
  );
}

export default App;
